class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        count_s = {}
        count_t = {}
        for char in s:
            count_s[char] = count_s.get(char, 0) + 1
        for char in t:
            if char not in count_s:
                return char
            count_t[char] = count_t.get(char, 0) + 1
        for char in count_t:
            if count_t[char] != count_s[char]:
                return char


class Solution2:
    def findTheDifference(self, s: str, t: str) -> str:
        s = sorted(s)
        t = sorted(t)
        for i, j in zip(s, t):
            if i != j:
                return j
        return t[-1]


class Solution3:
    def findTheDifference(self, s: str, t: str) -> str:
        ans = 0
        for i, j in zip(s, t):
            ans += ord(j)
            ans -= ord(i)
        ans += ord(t[-1])
        return chr(ans)


class Solution4:
    def findTheDifference(self, s: str, t: str) -> str:
        ans = 0
        for i, j in zip(s, t):
            ans ^= ord(j)
            ans ^= ord(i)
        ans ^= ord(t[-1])
        return chr(ans)


def test_1():
    assert Solution().findTheDifference("abcd", "abcde") == "e"


def test_2():
    assert Solution().findTheDifference("", "y") == "y"


def test_3():
    assert Solution().findTheDifference("a", "aa") == "a"


def test_4():
    assert (
        Solution().findTheDifference(
            "",
            "",
        )
        == "t"
    )


